import React from 'react'
import 'font-awesome/css/font-awesome.min.css';
import "./ListHerosection.js"
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
// import { solid, regular, brands, icon } from '@fortawesome/fontawesome-svg-core/import.macro'

// import "./ListHerosection.css"
const ListHerosection = () => {
    return (
        <>
            <div className='ListMain'>

                <div>
                <i class="fa-solid fa-earth-americas"></i>
                 <p>Network of 1000+ people</p>

                 <i class="fa-solid fa-users"></i>
                 <p>5000+ Students</p>

                 <i class="fa-sharp fa-solid fa-screwdriver-wrench"></i>
                 <p>100+ Workshops</p>


                 <p>15+ Years of Work Experience</p>
                </div>





            </div>

        </>
    )
}

export default ListHerosection
